  constructor(props){
    super(props);

    this.state = {
      flipCard: ""
    }

    this.rotate = this.rotate.bind(this);
    this.rotateBack = this.rotateBack.bind(this);
  }

 rotate(){
    this.setState({
       flipCard:"flip-card-rotate"
    })   
  }

  rotateBack(){
    console.log('hej');
     this.setState({
       flipCard:"flip-card"
    })  
  }

  render() {
    return (
      <div className="wrapper wrapper-startpage">
      <Header />

      <div id={this.state.flipCard} className="flip-card" onClick={this.rotate}>
