      </div>
      <div className="flip-card-back" onClick={this.rotateBack}>
      <h1>Passion</h1> 
      <p>Lorem</p> 
    </div>
  </div>
</div>
   <Carousel />    
 </div>
    )
  }
}

export default Home;
